        public static int NumIslands(char[,] grid)
        {
            int r = 0;
            for(int i = 0 ; i < grid.GetLength(0); i++)
            {
                for(int j = 0 ; j < grid.GetLength(1); j++)
                {
                   if(grid[i, j] == '1')
                   {
                       DFS(grid, i, j);
                       r++;
                   }
                }
            }
            return r;
        }
private static void DFS(char[,] grid, int row, int col)
        {
           if(!IsValidMove(grid, row, col))
           {
              return;
           }
           grid[row, col] = '0';
           int[] r = new int[]{0, 0, 1, -1};
           int[] c = new int[]{1, -1, 0, 0};
           for(int i = 0 ; i < r.Length; i++)
           {
               if(!IsValidMove(grid, row + r[i], col + c[i]))
                 continue;
               DFS(grid, row+r[i], col + c[i]);
           }
        } 

        private static bool IsValidMove(char[,] grid, int row, int col)
        {
            if(row >= grid.GetLength(0) || row < 0) return false;
            if(col >= grid.GetLength(1) || col < 0) return false;
            if(grid[row, col] == '0') return false;
            return true;
        }        
        
